import React from "react";
import { Switch, Route, BrowserRouter as Router } from "react-router-dom";
import { Feed, New } from "./pages";

export default () => {
  return (
    <Switch>
      <Router>
        <Route exact path="/" render={() => <Feed />} />
        <Route path="/new" render={() => <New />} />
      </Router>
    </Switch>
  );
};
